message:
Agora já tá dando pra saber como podem ser armadas as lutas individuais, pelo menos algumas. Começaremos assim :
1- Vovô hyou vs Hawkins( queen tá se lembrando de mais desse velho, acho que ele vai ter alguma luta importante, e Hawkins n teria change contra outro oponente, importante, acho justo essa luta kkkk);
2- Who’s who vs drake ( who’s who da a entender que encarar drake, Dara trabalho, então acho que seria uma luta justa e equilibrada);
3- inu e neko vs jack ( essa crina final, de todos os links caídos e eles dois indo pra cima do jack, acho que próxima vez que mostrar eles, vai ser algo como o X1 desenrolando) A n ser que eles ainda percam antes de encarar o jack na batalha final, Oda é complexo);
4- sasaki tem uma personalidade interessante, não parece ser rancoroso, to achando que o zoro vai esbarrar com ele, acho que daria uma luta boa;
5- sanji vai dar de cara com a Black Maria e vai levar uma baita surra, o tamanho da Black Maria, vai combinar perfeito com os golpes gigantes da Nico robin, acho que ela que vai salvar o sanji da morte ( já que ele luta contra mulher, e a Black Maria ainda é a dona do bordel que ele tanto buscava kkkk)

6- o restante n da pra saber ainda, tenho que ver os próximos caps, e se brincar, errei todas essas supostas lutas de X1, se fosse pra chutar alguma luta, eu chutaria chopper e usopp com ulti e page one, já que eles aparentemente lutam juntos, seria uma reprise lá de alabasta.( mas, seria melhor o usopp realizar a mentira dele, e derrotar todos os numbers, já que ele tá com o haki da obs agr, da pra fugir dos golpes deles, da pra correr melhor kkkkk.

O Hawkins é o típico em cima do muro, sempre passando pro lado de quem tá ganhando, não duvido que daqui a uns cap ele passe pro lado do Luffy também, isso se o Law não descer o cacete nele antes, junto com o Kid descendo o cacete no Apoo, vai ter muita batalha entre SuperNovas ainda;
O Gear Fourth tá se tornando o novo Gear Second, sendo usado toda hora, acredito que o Luffy vá despertar o Gear Fifth contra o Kaido, provável que ele chegue no telhado onde tá o Kaido por volta do cap 995 onde apareça os Nove Bainhas Vermelhas derrotados fazendo o Luffy usar o Gear Fifth ou despertar o potencial completo da Gomu Gomu no Mi, e talvez a técnica apareça até mesmo no capítulo 1000;
Ainda to esperando o Marco aparecer junto com o Perospero pra salvar o bando em algum momento, pode ser que o King tente atacar o Luffy enquanto ele está subindo pro telhado e o Marco apareça aí, sendo uma batalha entre 2 "pássaros" voando.
E baseando-se nos "spoilers de abertura" do anime, talvez os Grandes Astros possam até mesmo passar pro lado da Big Mom, só não sei como, já que a coitada vai pelo visto ficar rolando durante a guerra inteira e fazendo praticamente nada;
Que venha a tão esperada luta contra o Kaido.

alera, agora que parei pra pensar, lembrei de uma notícia do Oda, assim que começou wano, nesse ponto da obra, já estávamos a véspera do luffy vs kaido, a BM já se dirigia para wano. E obs: BM já havia aparecido frente a alguns chapéus de palha ( essa informação é importante); 
Notícia do Oda, escrita com minhas palavras, do que me lembro dela kkk: o maior inimigo dos chapéus de palha está “indo” ao encontro deles, uma das “lendas” de one piece vai aparecer. Levando essa mensagem do Oda em consideração, e os fatos iniciais citados, levanto os seguintes pontos na obra:
- BM indo pra wano já era se esperado;
- Kaido já era o inimigo a ser enfrentado, todos já sabiam que seria “casca grossa”;
- Os acontecimentos da reverie falam que o mais chocante seria uma morte, segundo Morgan’s, ele não fala em algo mais polêmico;
- Coby ( a caminho de prender um dos shichibukais, ( leve esse fato como o mais importante do momento do tempo decorrente da obra )) está falando com drake, coby está com a vez de fala, e fala sobre nem todo o poder da marinha reunido ser capaz de lidar com o problema;
- Em sequência, drake relata da união do kaido e BM ( notícia ainda fora do mundo, só sabiam do possível embate da BM com kaido), coby fica surpreso;
- Shanks visita os gorouseis, pra falar sobre um pirata ( acredito que foi pedir atenção, ou ajuda);
- Barba negra até esse ponto, não apresenta “ameaça” para o mundo ( o único movimento perigoso dele, foi a possível adição do aokiji ao seu bando). Como já teve uma cena com os gorouseis sobre isso, foi mostrado que eles não ficaram muito “perplexos”;
- Com a força do barba negra, o shanks não teria motivos pra tomar alguma atitude por agora;
- Após a união dos yonkou, o sengoku, conta sobre os rocks, fala sobre o desaparecimento de God valey, mas em nenhum momento fala da morte de rocks D. Xebec, só fala na sua derrota pelo garp e Roger;
- Somando os fatos citados a cima, e somando com a aparição de uma lenda. Acredito que rocks d xebec está vivo, e começou a se movimentar depois de muitos anos, e o motivo disso? A união de dois dos seus subordinados, ele pode ver aí a possiblidade de reunir os remanescentes do seu bando, essa lenda irá aparecer logo próximo ao final de wano. Viajei aqui nas ideias, pq lembrei da notícia do Oda, e so nada até agr, então comecei a especular, quem leu, valeu kkkkk não me julguem, tbem sonho alto

Galera, eu to achando que essa ideia de sword, pode ser algo como uma”neo marinha”, vamos aos fatos:
- a mantinha atual é corrupta e muito subjetiva sobre oque é certo e errado , já que se submetem aos comandos dos dragões celestiais, como sendo a ordem absoluta;
- Aokiji era um almirante, mas tá vagando atoa pelos mares, agora ele aparentemente tá com o BN, só que o aokiji foi mostrado pelo Oda, como sendo o almirante mais “humano” entre eles, até pelo fato de deixar a robin fugir e tals, Oda n criaria algo assim pra depois jogar na lama, colocando ele como leal ao BN;
- a marinha vai ter que, ou sofrer uma grande revolução, ou ter que ser extinta junto com o GM, quando o fim de one piece estiver próximo, já que fazem parte do “mal” do mundo junto com os piratas, luffy trará o amanhecer pra geral kkkk, entao...
- na sword existem patentes, podem observar a patente que o drake e coby possuem, dentro e fora da sword, ou seja, deve haver o cargo de almirante, chutaria que o aokiji ta nesse cargo;
- sengoku queria que o aokijii fosse o almirante de frota da marinha, so que o GM queria o Akainu, teve a batalha lá deles e. Aokiji saiu da marinha. O ponto é: o sengoku já comanda esses esquadrões secretos desde o corazon, acredito eu que o sengoku e o garp, são meio que os almirantes de frota da sword, agindo so com ordens e recrutando os “melhores” dos sangues novos da marinha, o sengoku tem seus motivos, porque já leva o jeito pra essas coisas, e tbem pq se decepcionou com o corrido na guerra dos melhores, e o garp, por conta de n gostar dos dragões e pelo fato do mal entendido entre ele e o sakazuki ( afinal, matou o Ace). Coby tá na sword, pq é o pupilo do garp, o resto é só deixar a imaginação fluir kkkkkk
